import styled from "styled-components";

const Top = styled.div`
  display: flex;
  width: 1920px;
  height: 53px;
  padding: 0px 492px 0px 493px;
  justify-content: center;
  align-items: center;
  flex-shrink: 0;
  background: var(--Dark-white, #FAFAFA);
`;

export default Top;
